INSERT INTO `wp_snippets` VALUES (10,'PROD COUNT','','add_filter(\'wp_nav_menu_items\', \'do_shortcode\');\nadd_shortcode (\'woo_cart_count\', \'woo_cart_count\');\n\nfunction woo_cart_count(){\n	ob_start();\n	$items_count = WC() -> cart -> get_cart_contents_count();?>\n	<a href="https://ninayco.helloeveryone.me/carrito/" class="prod_count">\n		<svg width="22" height="25" viewBox="0 0 22 25" fill="none" xmlns="http://www.w3.org/2000/svg">\n			<path d="M1.91641 10.0159C1.96195 9.43953 2.21956 8.90172 2.63793 8.50959C3.0563 8.11746 3.60473 7.89978 4.174 7.8999H17.826C18.3953 7.89978 18.9437 8.11746 19.3621 8.50959C19.7804 8.90172 20.038 9.43953 20.0836 10.0159L20.9927 21.5159C21.0177 21.8324 20.978 22.1507 20.8759 22.4508C20.7739 22.7509 20.6118 23.0263 20.3998 23.2596C20.1879 23.4929 19.9306 23.6792 19.6443 23.8066C19.358 23.934 19.0489 23.9998 18.7363 23.9999H3.26372C2.95115 23.9998 2.64198 23.934 2.35568 23.8066C2.06938 23.6792 1.81215 23.4929 1.60018 23.2596C1.38822 23.0263 1.22611 22.7509 1.12407 22.4508C1.02202 22.1507 0.982252 21.8324 1.00726 21.5159L1.91641 10.0159V10.0159Z" stroke="white" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>\n			<path d="M15.5287 11.35V5.6C15.5287 4.38 15.0516 3.20998 14.2023 2.34731C13.353 1.48464 12.2011 1 11 1C9.79886 1 8.64695 1.48464 7.79764 2.34731C6.94833 3.20998 6.47119 4.38 6.47119 5.6V11.35" stroke="white" stroke-width="2" stroke-linecap="round" stroke-linejoin="round"/>\n		</svg>\n		<span class="mini_cart_count"><?php echo $items_count ? $items_count : \'0\'; ?></span>\n	</a>\n<?php\n	return ob_get_clean();\n}\n\nadd_filter(\'woocommerce_add_to_cart_fragments\', \'wc_refresh_mini_cart_count\');\nfunction wc_refresh_mini_cart_count($fragments){\n	ob_start();\n	$items_count = WC() -> cart -> get_cart_contents_count();?>\n	<span class="mini_cart_count"><?php echo $items_count ? $items_count : \'0\'; ?></span>	\n<?php\n	$fragments [\'.mini_cart_count\'] = ob_get_clean();\n	return $fragments;\n}','','global',10,1,'2024-04-27 19:55:42',11,NULL);
INSERT INTO `wp_snippets` VALUES (11,'ADD TO CART - INPUT','','add_action(\'woocommerce_before_quantity_input_field\', \'btn_before_input_qty_field\');\nfunction btn_before_input_qty_field(){\n    echo \'<button type="button" class="button button-qty" data-quantity="minus">-</button>\';\n}\n\nadd_action(\'woocommerce_after_quantity_input_field\', \'btn_after_input_qty_field\');\nfunction btn_after_input_qty_field(){\n    echo \'<button type="button" class="button button-qty" data-quantity="plus">+</button>\';\n}','','global',10,1,'2024-04-27 02:58:52',4,NULL);
INSERT INTO `wp_snippets` VALUES (13,'SHOW VARIATIONS IN SHOP PAGE','','remove_action(\'woocommerce_after_shop_loop_item\', \'woocommerce_template_loop_add_to_cart\', 10);\nadd_action(\'woocommerce_after_shop_loop_item\', \'change_template_loop_add_to_cart\', 10);\nfunction change_template_loop_add_to_cart() {\n    global $product;\n\n    if ( ! $product->is_type(\'variable\')) {\n        woocommerce_template_loop_add_to_cart();\n        return;\n    }\n\n    remove_action(\'woocommerce_single_variation\', \'woocommerce_single_variation_add_to_cart_button\', 20);\n    add_action(\'woocommerce_single_variation\', \'add_loop_variation_add_to_cart_button\', 20);\n    woocommerce_template_single_add_to_cart();\n}\n\n\nfunction add_loop_variation_add_to_cart_button() {\n    global $product;\n?>\n    <div class="woocommerce-variation-add-to-cart variations_button">\n        <button type="submit" class="single_add_to_cart_button button"><?php echo esc_html($product->single_add_to_cart_text()); ?></button>\n        <input type="hidden" name="add-to-cart" value="<?php echo absint($product->get_id()); ?>" />\n        <input type="hidden" name="product_id" value="<?php echo absint($product->get_id()); ?>" />\n        <input type="hidden" name="variation_id" class="variation_id" value="0" />\n    </div>\n<?php\n}','','global',10,1,'2024-04-27 05:23:04',2,NULL);
INSERT INTO `wp_snippets` VALUES (19,'WPP FORM','','function wpp_form(){\n	$phone = jet_engine()->listings->data->get_option( \'mi-web::wpp_number\' );\n	echo \'<div>\n	<form class="wpp_form">\n        <label for="message">Tu mensaje</label>\n        <textarea name="message" id="message" cols="30" rows="5" placeholder="Escribe tu mensaje..."></textarea>\n        <a id="btnSend" class="disabled send_wpp_btn" target="_blank" href="">Continuar al chat</a>\n    </form>\n</div>\n\n<script>\n	let boxMessage = document.getElementById("message");\n	let btnSend = document.getElementById("btnSend");\n	let wppNumber = "\'. $phone .\'";\n\n	boxMessage.addEventListener("keyup", () => {\n		if (boxMessage.value.length != 0) {\n			btnSend.classList.remove("disabled");\n			let message = `https://api.whatsapp.com/send?phone=${wppNumber}&text=${boxMessage.value} `;\n			btnSend.href = message;\n		} else{\n			btnSend.classList.add("disabled");\n		}\n	});\n</script>\';\n}\nadd_shortcode(\'wpp_form_contact\', \'wpp_form\');\n','','global',10,1,'2024-04-29 18:58:45',9,NULL);
