INSERT INTO `wp_wc_admin_notes` VALUES (56,'woocommerce-WooPayments-Aug-2023-security-updated','update','en_US','Security update of WooPayments (WooCommerce Payments) plugin','<strong>Your store has been updated to the more secure version of WooPayments (WooCommerce Payments)</strong>. This update was released on July 31.','{}','pending','woocommerce.com','2024-02-01 19:49:45',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (57,'avalara_q3-2023_noAvaTax','marketing','en_US','Automatically calculate VAT in real time','Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTax— including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.','{}','pending','woocommerce.com','2024-02-01 19:49:45',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (58,'woo-activation-survey-blockers-22AUG23','info','en_US','How can we help you get that first sale?','Your feedback is vital. Please take a minute to share your experience of setting up your new store and whether anything is preventing you from making those first few sales. Together, we can make Woo even better!','{}','pending','woocommerce.com','2024-02-01 19:49:45',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (59,'woocommerce-usermeta-Sept2023-productvendors','update','en_US','Your store requires a security update','<strong>Your shop needs an update to address a vulnerability in WooCommerce.</strong> The fix was released on Sept 15. Please update WooCommerce to the latest version immediately. <a href="https://developer.woocommerce.com/2023/09/16/woocommerce-vulnerability-reintroduced-from-7-0-1/" />Read our developer update</a> for more information.','{}','pending','woocommerce.com','2024-02-01 19:49:45',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (60,'woocommerce-STRIPE-Oct-2023-update-needed','update','en_US','Action required: Security update for WooCommerce Stripe Gateway','<strong>Your shop requires a security update to address a vulnerability in the WooCommerce Stripe Gateway</strong>. The fix for this vulnerability was released on October 17. Please update immediately.','{}','pending','woocommerce.com','2024-02-01 19:49:45',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (61,'amazon-mcf-reviews-2023-12-07','marketing','en_US','Enjoying Amazon MCF for WooCommerce?','We\'re Never Settle, the developers behind Amazon MCF for WooCommerce, and would be deeply honored to have your review. Reviews help immensely as other users can learn how MCF can solve their needs too! Not happy or need help? Please reach out for support and we’d love to make things right!','{}','pending','woocommerce.com','2024-02-01 19:49:45',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (62,'amazon_pay_reactivate_q1-24','marketing','en_US','Special offer: Activate 0% promo rate for Amazon Pay','For a limited time, Woo merchants who register with Amazon Pay can enjoy a promotional rate of 0% on all transaction fees for 30 days. Valid for businesses based in the United Kingdom. Terms and conditions apply.','{}','pending','woocommerce.com','2024-02-01 19:49:45',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (63,'remove_estimated_deposits_2024','marketing','en_US','Estimated deposits are going away','To provide more accurate deposit information and support the expansion of instant deposits, estimated deposit details will no longer be available in WooPayments. We recommend upgrading to the latest version of WooPayments for more detailed balance status information.','{}','pending','woocommerce.com','2024-02-01 19:49:45',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (64,'wc-admin-onboarding-payments-reminder','info','en_US','¡Empieza a aceptar pagos en tu tienda!','Acepta pagos mediante el proveedor adecuado para ti - elige entre más de 100 pasarelas de pago para WooCommerce.','{}','unactioned','woocommerce-admin','2024-02-28 16:15:30',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (65,'wc-admin-usage-tracking-opt-in','info','en_US','Ayuda a WooCommerce a mejorar con el seguimiento de uso','Recopilar datos de uso nos permite mejorar WooCommerce. Se tendrá en cuenta a tu tienda a medida que evaluamos nuevas características, juzgamos la calidad de una actualización o determinamos si una mejora tiene sentido. Siempre puedes visitar los <a href="https://ninayco.helloeveryone.me/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com" target="_blank">Ajustes</a> y elegir dejar de compartir datos. <a href="https://woo.com/usage-tracking?utm_medium=product" target="_blank">Lee más</a> sobre los datos que recopilamos.','{}','unactioned','woocommerce-admin','2024-02-28 16:15:30',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (66,'wc-admin-woocommerce-payments','marketing','en_US','Prueba la nueva forma de cobrar','Acepta de forma segura en tu sitio tarjetas de crédito y débito. Gestiona las transacciones sin salir de tu escritorio de WordPress. Solo con <strong>WooPayments</strong>.<br><br>Al hacer clic en «Iniciar», aceptas nuestros <a href="https://wordpress.com/tos/" target="_blank">términos de servicio</a>','{}','unactioned','woocommerce-admin','2024-02-28 16:15:30',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (67,'wc-update-db-reminder','update','en_US','Actualización de la base de datos de WooCommerce terminada','Actualización de la base de datos de WooCommerce completa. ¡Gracias por actualizar a la última versión!','{}','actioned','woocommerce-core','2024-02-28 16:19:53',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (68,'wc_admin_UKpricingchange_WCPay_Q1_2024','marketing','en_US','Fee Changes for WooPayments in the EEA and UK','WooPayments fees for transactions between the EEA and UK will change as of 1st March, 2024. Transactions between the UK and EEA are now deemed by card networks to be cross-border, thus international payment fees will be applicable. This also changes base processing fees.','{}','pending','woocommerce.com','2024-03-13 21:27:05',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (69,'airwallex_q1_2024','marketing','en_US','Save big on foreign exchange (FX) fees','Boost your international sales by offering Apple Pay, Google Pay, and 60+ local payment methods with Airwallex. Save time and money by settling payments directly in USD, EUR, HKD, SGD, AUD, and more — without the extra FX fees. Simple, cost-effective, fast.','{}','unactioned','woocommerce.com','2024-03-13 21:27:05',NULL,0,'plain','',0,1,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (70,'checkout_survey_new_users','survey','en_US','We\'d like your feedback on WooCommerce checkout','Your feedback is essential for us to improve the WooCommerce checkout and increase your conversion rate, turning more visitors into customers. Answer a few questions to help us understand your experience. It shouldn\'t take more than 5 minutes of your time.','{}','pending','woocommerce.com','2024-04-23 22:21:13',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (71,'wc-admin-launch-checklist','info','en_US','¿Estás preparado para lanzar tu tienda?','Para asegurarnos de que nunca tengas esa sensación de «¿Qué se me olvidó?» hemos preparado la lista de comprobación esencial de despegue.','{}','unactioned','woocommerce-admin','2024-04-29 19:38:34',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (72,'affirm_q2_2024','marketing','en_US','Boost sales and increase average order value with Affirm!','Affirm’s flexible payment options empower customers to get exactly what they want, while making budget-friendly payments. Remove the price barrier and make it even easier for your customers to upgrade, bundle, and add on — with no late fees and clear payment plans. \r\n\r\n* Subject to eligibility. Terms apply.','{}','pending','woocommerce.com','2024-04-29 19:38:38',NULL,0,'plain','',0,0,'info');
INSERT INTO `wp_wc_admin_notes` VALUES (73,'checkout_survey_new_users_no_orders','survey','en_US','We\'d like your feedback on WooCommerce checkout','Your feedback is essential for us to improve the WooCommerce checkout and increase your conversion rate, turning more visitors into customers. Answer a few questions to help us understand your experience. It shouldn\'t take more than 5 minutes of your time.','{}','unactioned','woocommerce.com','2024-04-30 19:45:07',NULL,0,'plain','',0,0,'info');
