INSERT INTO `wp_cerber_sets` VALUES ('azoth_loaded_es_ES',0,'a:3:{s:10:"kb_updated";i:1707144814;s:7:"version";s:5:"9.6.2";s:5:"azoth";a:4:{s:8:"activity";a:8:{i:7;a:6:{s:7:"kb_desc";s:506:"Este evento se produjo porque se utilizó una contraseña incorrecta al intentar iniciar sesión en su sitio web o porque las cookies de autenticación de usuario habían caducado. Si bien los inicios de sesión fallidos son comunes y pueden ocurrir simplemente debido a un error del usuario, los fallos repetidos desde la misma dirección IP pueden indicar un intento de ataque de fuerza bruta. WP Cerber monitorea estas fallas y bloquea direcciones IP maliciosas para mitigar los ataques de fuerza bruta.";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:5:"login";s:6:"kb_url";s:50:"https://wpcerber.com/troubleshooting-login-issues/";s:12:"kb_hash.desc";s:32:"c7e17c6288dd84877a892cc8597bbd41";}i:6;a:5:{s:7:"kb_desc";s:0:"";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";}i:52;a:7:{s:7:"kb_desc";s:577:"Este intento de inicio de sesión se bloqueó porque el nombre de usuario (inicio de sesión) coincide con uno de los nombres de usuario prohibidos configurados en la configuración de WP Cerber.\r\n\r\nLos nombres de usuario prohibidos suelen ser nombres de usuario comunes como "admin" o "administrador", que se utilizan en ataques de fuerza bruta para obtener acceso no autorizado. WP Cerber bloquea automáticamente los intentos de inicio de sesión con estos nombres de usuario para eliminar el riesgo de acceso no autorizado al adivinar las credenciales de inicio de sesión.";s:9:"kb_action";s:117:"Si este comportamiento afecta a un usuario legítimo, considere actualizar la lista de nombres de usuario prohibidos.";s:6:"kb_sts";a:1:{i:0;s:10:"prohibited";}s:7:"kb_tags";s:17:"login, prohibited";s:6:"kb_url";s:53:"https://wpcerber.com/using-list-of-prohibited-logins/";s:12:"kb_hash.desc";s:32:"f371c3f6fdfd74c9bb4b7f01b76b5895";s:14:"kb_hash.action";s:32:"90ecb0d3f325af81f7ac79c628597c10";}i:70;a:5:{s:7:"kb_desc";s:0:"";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";}i:51;a:6:{s:7:"kb_desc";s:553:"Un usuario o una computadora intentó iniciar sesión con un nombre de usuario (iniciar sesión) que no existe en su sitio de WordPress. Intentos como este suelen ser signos de un ataque de fuerza bruta, en el que un atacante o un script informático automatizado adivina los nombres de usuario para obtener acceso no autorizado. WP Cerber detiene estos intentos y bloquea direcciones IP sospechosas. También es posible que un usuario legítimo haya cometido un error tipográfico al ingresar su nombre de usuario en el formulario de inicio de sesión.";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";s:12:"kb_hash.desc";s:32:"1a0b1d3c7176c1d18f352d22da9afc7e";}i:55;a:7:{s:7:"kb_desc";s:577:"WP Cerber identificó esta solicitud como un intento de identificar software defectuoso, configuraciones de seguridad inadecuadas, configuraciones incorrectas del servidor o descubrir vulnerabilidades conocidas dentro del software de su sitio. Este tipo de sondeo es una táctica comúnmente utilizada por atacantes que buscan puntos de entrada para inyectar código malicioso u obtener acceso no autorizado. WP Cerber detecta y bloquea proactivamente estas actividades sospechosas, evitando así posibles violaciones de seguridad y garantizando que su sitio permanezca seguro.";s:9:"kb_action";s:336:"Si los usuarios legítimos o las direcciones IP confiables se ven afectados, considere configurar excepciones en la configuración del Inspector de tráfico. Para solicitudes de servicios web externos confiables, considere incluir en la lista blanca la dirección IP correspondiente o configurar excepciones basadas en encabezados HTTP.";s:6:"kb_sts";a:4:{i:0;s:9:"tienabled";i:1;s:9:"tiipwhite";i:2;s:7:"tiwhite";i:3;s:14:"tiwhite_header";}s:7:"kb_tags";s:0:"";s:6:"kb_url";s:53:"https://wpcerber.com/traffic-inspector-in-a-nutshell/";s:12:"kb_hash.desc";s:32:"e80f19f3c9cfeb7528c8b8218bc6f4e9";s:14:"kb_hash.action";s:32:"8a4f6001ed50eec43c56caf4350146d3";}i:50;a:7:{s:7:"kb_desc";s:380:"La dirección IP intentó obtener acceso a una URL crítica en su sitio web que está estrictamente prohibida y se sabe que es blanco de ataques automatizados. Esto incluye ubicaciones de administrador críticas, la URL de registro integrada y los scripts PHP de inicio de sesión y registro predeterminados. Puede desactivar este comportamiento en la configuración de WP Cerber.";s:9:"kb_action";s:166:"Si este bloqueo afecta a un usuario legítimo, considere incluir en la lista blanca la dirección IP confiable o la red confiable a la que pertenece la dirección IP.";s:6:"kb_sts";a:1:{i:0;s:7:"wplogin";}s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";s:12:"kb_hash.desc";s:32:"03cfc1d9a73810fb262a6ff647f11ec5";s:14:"kb_hash.action";s:32:"0470b9fed5c85ff6d761bebb20bab672";}i:71;a:7:{s:7:"kb_desc";s:677:"WP Cerber denegó un intento de acceder a la API XML-RPC de WordPress. La API XML-RPC es un protocolo de llamada a procedimiento remoto (RPC) que utiliza XML para codificar sus llamadas y HTTP como mecanismo de transporte, lo que permite que las computadoras remotas ejecuten comandos en su sitio web. Sin embargo, también es un objetivo común para los atacantes debido a sus poderosas capacidades.\r\n\r\nWP Cerber restringe el acceso a esta API como medida de seguridad para evitar intentos no autorizados de explotarla, que podrían incluir ataques de fuerza bruta, ataques DDoS y otras actividades maliciosas destinadas a obtener acceso no autorizado o interrumpir servicios.";s:9:"kb_action";s:179:"Si se rechazan las solicitudes legítimas a la API XML-RPC, considere incluir en la lista blanca la dirección IP confiable o la red confiable a la que pertenece la dirección IP.";s:6:"kb_sts";a:1:{i:0;s:6:"xmlrpc";}s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";s:12:"kb_hash.desc";s:32:"199f0a3a540f8710068c05063fda839a";s:14:"kb_hash.action";s:32:"6aee381765198a94ac4eb352abae3805";}}s:6:"status";a:5:{i:18;a:5:{s:7:"kb_desc";s:0:"";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";}i:10;a:5:{s:7:"kb_desc";s:0:"";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";}i:40;a:6:{s:7:"kb_desc";s:601:"Indica que WordPress detectó y eliminó las cookies caducadas, corruptas o alteradas asociadas con la sesión de un usuario. En el contexto de un sitio web de WordPress, las cookies se utilizan para administrar la información de la sesión, incluidos los detalles de autenticación. Esas cookies de usuario se verifican para cada solicitud de usuario enviada a su sitio web. Si bien este evento puede indicar posibles amenazas a la seguridad, no siempre es una señal de un intento malicioso. A veces, puede deberse a problemas benignos, como fallos del navegador o datos de sesión desactualizados.";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";s:12:"kb_hash.desc";s:32:"3af1344633ef6dbb106fe62dd4a1c11c";}i:502;a:5:{s:7:"kb_desc";s:0:"";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";}i:13;a:6:{s:7:"kb_desc";s:506:"La solicitud fue denegada porque se bloqueó temporalmente el acceso de la dirección IP a su sitio web. Este bloqueo generalmente resulta de demasiadas solicitudes sospechosas, intentos fallidos de inicio de sesión o intentos de escanear su sitio web en busca de infracciones y vulnerabilidades, entre otras actividades maliciosas que activaron las políticas de seguridad de WP Cerber. Puede encontrar el motivo exacto para bloquear la dirección IP en el registro de actividad o en la pestaña Bloqueo.";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";s:12:"kb_hash.desc";s:32:"c17e91b637aaf4de36836d8316725ad1";}}s:6:"reason";a:13:{i:701;a:7:{s:7:"kb_desc";s:448:"La dirección IP se bloqueó porque superó el número máximo de intentos de inicio de sesión establecidos en la configuración del complemento. Este bloqueo suele ser indicativo de un ataque de fuerza bruta, en el que un atacante intenta varias combinaciones de inicio de sesión y contraseña para obtener acceso no autorizado. Para mitigar tales ataques, WP Cerber bloquea automáticamente las direcciones IP que superan el umbral configurado.";s:9:"kb_action";s:289:"Si este bloqueo afecta a los usuarios legítimos con demasiada frecuencia, debe ajustar los umbrales de intento de inicio de sesión en la configuración de WP Cerber o considerar incluir en la lista blanca la dirección IP confiable o la red confiable a la que pertenece la dirección IP.";s:6:"kb_sts";a:2:{i:0;s:14:"limit_attempts";i:1;s:10:"aggressive";}s:7:"kb_tags";s:11:"limit,login";s:6:"kb_url";s:46:"https://wpcerber.com/wordpress-login-security/";s:12:"kb_hash.desc";s:32:"e4c9a50f6953a361247e5fb672b4c73e";s:14:"kb_hash.action";s:32:"6ee088ddc68e6ce711adddb63381fba4";}i:705;a:7:{s:7:"kb_desc";s:603:"La dirección IP se bloqueó porque excedió el número máximo de intentos fallidos para resolver reCAPTCHA. Los intentos fallidos excesivos suelen indicar actividad de bot, ya que los bots pueden enviar formularios repetidamente sin completar con éxito el desafío reCAPTCHA. Esta medida de seguridad ayuda a proteger su sitio contra el spam y el abuso al bloquear el tráfico que parece generado por bots. Sin embargo, los usuarios legítimos pueden ocasionalmente tener problemas con reCAPTCHA debido a un diseño desordenado o confuso en el formulario, lo que lleva a múltiples intentos fallidos.";s:9:"kb_action";s:551:"Si los usuarios legítimos se ven afectados por este bloqueo, considere revisar el diseño de la página web que contiene el formulario protegido y verificar la configuración de reCAPTCHA. Verifique la configuración de WP Cerber y asegúrese de la validez de la clave del sitio y los secretos del sitio proporcionados por Google para su sitio web. Además, puede desactivar reCAPTCHA para los usuarios que han iniciado sesión o considerar incluir en la lista blanca la dirección IP confiable o la red confiable a la que pertenece la dirección IP.";s:6:"kb_sts";a:3:{i:0;s:7:"sitekey";i:1;s:9:"secretkey";i:2;s:10:"recaplimit";}s:7:"kb_tags";s:27:"reCAPTCHA, atnti-spam, spam";s:6:"kb_url";s:44:"https://wpcerber.com/how-to-setup-recaptcha/";s:12:"kb_hash.desc";s:32:"fff10e0430504f60db17587d50b1f6ac";s:14:"kb_hash.action";s:32:"50e226bf2e57add0d7c6cdd8003b1a8c";}i:704;a:7:{s:7:"kb_desc";s:564:"La dirección IP se bloqueó debido a un intento de iniciar sesión en WordPress utilizando un nombre de usuario (iniciar sesión) que está prohibido en la configuración de WP Cerber. Los nombres de usuario prohibidos suelen ser nombres de usuario comunes como "admin" o "administrador", que se utilizan en ataques de fuerza bruta para obtener acceso no autorizado. WP Cerber bloquea automáticamente los intentos de inicio de sesión con estos nombres de usuario para eliminar el riesgo de acceso no autorizado al adivinar las credenciales de inicio de sesión.";s:9:"kb_action";s:110:"Si este bloqueo afecta a un usuario legítimo, considere actualizar la lista de nombres de usuario prohibidos.";s:6:"kb_sts";a:1:{i:0;s:10:"prohibited";}s:7:"kb_tags";s:27:"prohibited, login, username";s:6:"kb_url";s:53:"https://wpcerber.com/using-list-of-prohibited-logins/";s:12:"kb_hash.desc";s:32:"80c8d6f3804dace35d1b45802b5005fe";s:14:"kb_hash.action";s:32:"4fd9165f1a932d343d37f25a3e6ede6e";}i:708;a:7:{s:7:"kb_desc";s:669:"Esta dirección IP fue bloqueada porque estaba escaneando su sitio web en busca de códigos vulnerables. Este comportamiento implica realizar solicitudes específicas destinadas a identificar software defectuoso, configuraciones de seguridad inadecuadas, configuraciones incorrectas del servidor o descubrir vulnerabilidades conocidas dentro del software de su sitio. Este tipo de sondeo es una táctica común utilizada por los atacantes para encontrar puntos de entrada para inyectar código malicioso u obtener acceso no autorizado. WP Cerber detecta y bloquea estas actividades sospechosas para evitar posibles violaciones de seguridad, manteniendo su sitio seguro.";s:9:"kb_action";s:336:"Si los usuarios legítimos o las direcciones IP confiables se ven afectados, considere configurar excepciones en la configuración del Inspector de tráfico. Para solicitudes de servicios web externos confiables, considere incluir en la lista blanca la dirección IP correspondiente o configurar excepciones basadas en encabezados HTTP.";s:6:"kb_sts";a:4:{i:0;s:9:"tienabled";i:1;s:9:"tiipwhite";i:2;s:7:"tiwhite";i:3;s:14:"tiwhite_header";}s:7:"kb_tags";s:17:"firewall, request";s:6:"kb_url";s:63:"https://wpcerber.com/wordpress-probing-for-vulnerable-php-code/";s:12:"kb_hash.desc";s:32:"7f70a419c0cb0f7596649fc16cb290c2";s:14:"kb_hash.action";s:32:"8a4f6001ed50eec43c56caf4350146d3";}i:703;a:7:{s:7:"kb_desc";s:531:"Esta dirección IP fue bloqueada después de intentar iniciar sesión con un nombre de usuario (iniciar sesión) que no existe en su sitio de WordPress. Intentos como este suelen ser signos de un ataque de fuerza bruta, en el que un atacante adivina los nombres de usuario para obtener acceso no autorizado. WP Cerber detiene estos intentos y bloquea direcciones IP sospechosas. También es posible que un usuario legítimo haya cometido un error tipográfico al ingresar su nombre de usuario en el formulario de inicio de sesión.";s:9:"kb_action";s:193:"Puede desactivar este comportamiento en la configuración de WP Cerber o considerar incluir en la lista blanca la dirección IP confiable o la red confiable a la que pertenece la dirección IP.";s:6:"kb_sts";a:2:{i:0;s:10:"limitwhite";i:1;s:8:"nonusers";}s:7:"kb_tags";s:15:"login, username";s:6:"kb_url";s:0:"";s:12:"kb_hash.desc";s:32:"9aa1189a7cb956e6e8adb0fc8985c0af";s:14:"kb_hash.action";s:32:"02d3d1de32774bb4d09ee6e90daea002";}i:702;a:7:{s:7:"kb_desc";s:390:"La dirección IP se bloqueó debido a un intento de acceder a una URL de su sitio web que está estrictamente prohibida y se sabe que es blanco de ataques automatizados. Esto incluye ubicaciones de administrador críticas, la URL de registro integrada y los scripts PHP de inicio de sesión y registro predeterminados. Puede desactivar este comportamiento en la configuración de WP Cerber.";s:9:"kb_action";s:166:"Si este bloqueo afecta a un usuario legítimo, considere incluir en la lista blanca la dirección IP confiable o la red confiable a la que pertenece la dirección IP.";s:6:"kb_sts";a:1:{i:0;s:7:"wplogin";}s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";s:12:"kb_hash.desc";s:32:"e40a33d74fd198ba1b48df43a3abe5dd";s:14:"kb_hash.action";s:32:"0470b9fed5c85ff6d761bebb20bab672";}i:710;a:7:{s:7:"kb_desc";s:624:"La dirección IP fue bloqueada porque intentó cargar un archivo que contenía un código sospechoso en su sitio web. Cuando alguien envía un formulario u otra computadora envía una solicitud que contiene archivos, WP Cerber escanea los archivos enviados en busca de signos de malware, scripts y otros códigos dañinos. Esta medida de protección es crucial para evitar la ejecución de código no autorizado, lo que podría provocar violaciones de datos, destrucción del sitio u otros incidentes de seguridad. Si cree que este bloqueo es un falso positivo, considere revisar la configuración del Inspector de tráfico.";s:9:"kb_action";s:331:"Si los usuarios legítimos o las direcciones IP confiables se ven afectados, debe configurar excepciones en la configuración del Inspector de tráfico. Para solicitudes de servicios web externos confiables, considere incluir en la lista blanca la dirección IP correspondiente o configurar excepciones basadas en encabezados HTTP.";s:6:"kb_sts";a:4:{i:0;s:9:"tienabled";i:1;s:9:"tiipwhite";i:2;s:7:"tiwhite";i:3;s:14:"tiwhite_header";}s:7:"kb_tags";s:68:"firewall, request, malware, traffic inspector, uploads, upload, file";s:6:"kb_url";s:62:"https://wpcerber.com/firewall-http-requests-are-being-blocked/";s:12:"kb_hash.desc";s:32:"38b724b449a3a1715eaf4c04629e4929";s:14:"kb_hash.action";s:32:"8e460f5f5944aa5b660ec3708833885f";}i:725;a:6:{s:7:"kb_desc";s:715:"La dirección IP se bloqueó porque superó el número máximo de intentos permitidos para restablecer una contraseña mediante el formulario de restablecimiento de contraseña. Limitar el número de intentos de restablecimiento de contraseña tiene dos propósitos importantes: ayuda a proteger las cuentas de usuario para que no se vean comprometidas mediante intentos de fuerza bruta para adivinar nombres de usuario válidos y evita el abuso del formulario de restablecimiento de contraseña, que puede ser el objetivo de atacantes que buscan abrumar o explotar. el servidor web. Esta medida de seguridad garantiza la integridad y seguridad de las cuentas de usuario y mantiene la salud general de su sitio web.";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";s:12:"kb_hash.desc";s:32:"0168447cba8eda7d940bc6bcc475df2a";}i:721;a:6:{s:7:"kb_desc";s:536:"Esta dirección IP fue bloqueada porque excedió el número máximo de intentos permitidos para ingresar el código de autenticación de dos factores (2FA). Este límite es una medida de seguridad crítica para evitar que los atacantes utilicen fuerza bruta en el formulario 2FA y adivinen el código 2FA, protegiendo así las cuentas de sus usuarios contra el acceso no autorizado. Esta protección garantiza que incluso si una contraseña se ve comprometida, la capa adicional de seguridad proporcionada por 2FA sigue siendo efectiva.";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:30:"2fa, Two-Factor Authentication";s:6:"kb_url";s:61:"https://wpcerber.com/two-factor-authentication-for-wordpress/";s:12:"kb_hash.desc";s:32:"0898e2da9436e64f19c644912a876ad2";}i:706;a:7:{s:7:"kb_desc";s:703:"La dirección IP fue bloqueada debido a un exceso de solicitudes de spam. Esto suele incluir numerosos comentarios spam o envíos de formularios generados por robots de spam. El mecanismo antispam de WP Cerber está diseñado para identificar y bloquear dicha actividad excesiva para proteger su sitio del spam.\r\n\r\nSi ve que los usuarios legítimos se ven afectados, esto a menudo indica falsos positivos, generalmente debido a un conflicto con otro complemento, comúnmente un complemento de almacenamiento en caché. En tales casos, deberá borrar el caché en el complemento de almacenamiento en caché. Además, puede desactivar el antispam de WP Cerber para los usuarios que hayan iniciado sesión.";s:9:"kb_action";s:178:"Para solicitudes POST de servicios web externos confiables, considere incluir en la lista blanca la dirección IP correspondiente o configurar excepciones basadas en encabezados.";s:6:"kb_sts";a:4:{i:0;s:8:"botssafe";i:1;s:10:"botsnoauth";i:2;s:9:"botswhite";i:3;s:16:"botswhite_header";}s:7:"kb_tags";s:15:"anti-spam, bots";s:6:"kb_url";s:66:"https://wpcerber.com/antispam-exception-for-specific-http-request/";s:12:"kb_hash.desc";s:32:"275452773f133ccdc268ee79138c0eef";s:14:"kb_hash.action";s:32:"5979a224279ace8195b7863001377ad1";}i:707;a:6:{s:7:"kb_desc";s:600:"Esta dirección IP fue bloqueada debido a la detección de una amplia gama de actividades sospechosas, identificadas mediante el monitoreo continuo del registro de seguridad. Dichas actividades pueden incluir intentos de inicio de sesión y registro no autorizados, violaciones de políticas de seguridad, búsqueda de vulnerabilidades, escaneo en busca de infracciones e intentos de cargar archivos maliciosos o enviar solicitudes de spam. Al analizar proactivamente el registro de seguridad, WP Cerber garantiza que dichos comportamientos se detecten y mitiguen rápidamente para proteger su sitio.";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";s:12:"kb_hash.desc";s:32:"4309609a53eb0d31d8e8733411a05905";}i:711;a:7:{s:7:"kb_desc";s:641:"La dirección IP se bloqueó debido a una gran cantidad de solicitudes erróneas, que son solicitudes que el servidor web no puede procesar, lo que a menudo genera códigos de error a partir del código HTTP 400 y superior. Si bien algunos errores pueden ser inofensivos, debido a enlaces rotos en los menús del sitio web, otros, particularmente aquellos que desencadenan errores del lado del servidor (códigos HTTP 500 y superiores), pueden indicar intentos de los atacantes de explotar el servidor. Estos podrían tener como objetivo extraer información confidencial de mensajes de error o sobrecargar el servidor con tráfico excesivo.";s:9:"kb_action";s:322:"Si las direcciones IP confiables se bloquean regularmente, ajuste el "Modo de protección de errores" a "Máxima compatibilidad" dentro de la configuración del Inspector de tráfico. De manera similar, si los usuarios legítimos son bloqueados con frecuencia, considere habilitar la opción "Ignorar usuarios conectados".";s:6:"kb_sts";a:2:{i:0;s:8:"tierrmon";i:1;s:11:"tierrnoauth";}s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";s:12:"kb_hash.desc";s:32:"75d7495392dbeeb648cd2da62db8845b";s:14:"kb_hash.action";s:32:"a594b44a3747129ec6c393b1894c8063";}i:709;a:7:{s:7:"kb_desc";s:628:"La dirección IP fue bloqueada porque intentó enviar una solicitud que contenía un código sospechoso. Cuando alguien u otra computadora envía una solicitud que contiene campos POST o GET a su sitio web, WP Cerber escanea esos campos en busca de signos de malware, JavaScript, scripts PHP y otro código ejecutable similar. Esta medida de protección es crucial para evitar la ejecución de código no autorizado, lo que podría provocar violaciones de datos, destrucción del sitio u otros incidentes de seguridad. Si cree que este bloqueo es un falso positivo, considere revisar la configuración del Inspector de tráfico.";s:9:"kb_action";s:331:"Si los usuarios legítimos o las direcciones IP confiables se ven afectados, debe configurar excepciones en la configuración del Inspector de tráfico. Para solicitudes de servicios web externos confiables, considere incluir en la lista blanca la dirección IP correspondiente o configurar excepciones basadas en encabezados HTTP.";s:6:"kb_sts";a:4:{i:0;s:9:"tienabled";i:1;s:9:"tiipwhite";i:2;s:7:"tiwhite";i:3;s:14:"tiwhite_header";}s:7:"kb_tags";s:45:"firewall, request, malware, traffic inspector";s:6:"kb_url";s:62:"https://wpcerber.com/firewall-http-requests-are-being-blocked/";s:12:"kb_hash.desc";s:32:"7c412c0555176702854a4b537e350540";s:14:"kb_hash.action";s:32:"8e460f5f5944aa5b660ec3708833885f";}}s:8:"settings";a:2:{s:15:"nologinhint_msg";a:5:{s:7:"kb_desc";s:0:"";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";}s:7:"ds_4acc";a:5:{s:7:"kb_desc";s:0:"";s:9:"kb_action";s:0:"";s:6:"kb_sts";s:0:"";s:7:"kb_tags";s:0:"";s:6:"kb_url";s:0:"";}}}}',0,0);
