INSERT INTO `wp_posts` VALUES (2,1,'2024-02-01 15:01:54','2024-02-01 15:01:54','','Nina','Sumérgete en el mundo de la moda con nuestra colección exclusiva de prendas elegantes y modernas.','publish','closed','closed','','inicio','','','2024-04-30 20:28:12','2024-04-30 23:28:12','',0,'http://nina.local/?page_id=2',0,'page','',0);
INSERT INTO `wp_posts` VALUES (3,1,'2024-02-01 15:01:54','2024-02-01 15:01:54','<!-- wp:heading -->\n<h2 class="wp-block-heading">Quiénes somos.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Nuestro sitio web es: [jet_engine_data dynamic_field_source="options_page" dynamic_field_option="mi-web::site_url"]</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">Comentarios.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Cuando los visitantes dejan comentarios en el sitio, recopilamos los datos que se muestran en el formulario de comentarios, y también la dirección IP del visitante y la cadena de agente de usuario del navegador para ayudar a la detección de spam.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Es posible que se proporcione al servicio Gravatar una cadena anónima creada a partir de su dirección de correo electrónico (también llamada hash) para ver si la está utilizando. La política de privacidad del servicio Gravatar está disponible aquí: https://automattic.com/privacy/. Después de la aprobación de su comentario, su foto de perfil será visible para el público en el contexto de su comentario.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">Medios.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si subes imágenes al sitio web, debes evitar subir imágenes con datos de ubicación incrustados (GPS EXIF) incluidos. Los visitantes del sitio web pueden descargar y extraer cualquier dato de ubicación de las imágenes del sitio web.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">Cookies.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si deja un comentario en nuestro sitio, puede optar por guardar su nombre, dirección de correo electrónico y sitio web en cookies. Esto es para tu comodidad para que no tengas que volver a completar tus datos cuando dejes otro comentario. Estas cookies tendrán una duración de un año.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Si visita nuestra página de inicio de sesión, configuraremos una cookie temporal para determinar si su navegador acepta cookies. Esta cookie no contiene datos personales y se descarta al cerrar el navegador.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Cuando inicie sesión, también configuraremos varias cookies para guardar su información de inicio de sesión y sus opciones de visualización de pantalla. Las cookies de inicio de sesión duran dos días y las cookies de opciones de pantalla duran un año. Si selecciona "Recordarme", su inicio de sesión persistirá durante dos semanas. Si cierra sesión en su cuenta, se eliminarán las cookies de inicio de sesión.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Si edita o publica un artículo, se guardará una cookie adicional en su navegador. Esta cookie no incluye datos personales y simplemente indica el ID de la publicación del artículo que acaba de editar. Caduca después de 1 día.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">Contenido incrustado de otros sitios.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Los artículos de este sitio pueden incluir contenido incrustado (por ejemplo, vídeos, imágenes, artículos, etc.). El contenido incrustado de otros sitios web se comporta exactamente de la misma manera que si el visitante hubiera visitado el otro sitio web.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Estos sitios web pueden recopilar datos sobre usted, utilizar cookies, incorporar seguimiento adicional de terceros y monitorear su interacción con ese contenido incrustado, incluido el seguimiento de su interacción con el contenido incrustado si tiene una cuenta y ha iniciado sesión en ese sitio web.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">Con quién compartimos tus datos.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si solicita un restablecimiento de contraseña, su dirección IP se incluirá en el correo electrónico de restablecimiento.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">Cuánto tiempo conservamos sus datos.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si deja un comentario, el comentario y sus metadatos se conservan indefinidamente. Esto es para que podamos reconocer y aprobar cualquier comentario de seguimiento automáticamente en lugar de mantenerlos en una cola de moderación.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Para los usuarios que se registran en nuestro sitio web (si los hay), también almacenamos la información personal que proporcionan en su perfil de usuario. Todos los usuarios pueden ver, editar o eliminar su información personal en cualquier momento (excepto que no pueden cambiar su nombre de usuario). Los administradores del sitio web también pueden ver y editar esa información.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">Qué derechos tienes sobre tus datos.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Si tiene una cuenta en este sitio o ha dejado comentarios, puede solicitar recibir un archivo exportado de los datos personales que tenemos sobre usted, incluidos los datos que nos haya proporcionado. También puede solicitar que borremos cualquier dato personal que tengamos sobre usted. Esto no incluye ningún dato que estemos obligados a conservar con fines administrativos, legales o de seguridad.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2 class="wp-block-heading">Dónde se envían tus datos.</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Los comentarios de los visitantes pueden revisarse a través de un servicio automatizado de detección de spam.</p>\n<!-- /wp:paragraph -->','Política de privacidad','Tu confianza es nuestra prioridad, y estamos comprometidos a proteger tus datos en todo momento. Explora nuestra política de privacidad para conocer todos los detalles.','publish','closed','closed','','politica-de-privacidad','','','2024-04-30 20:29:50','2024-04-30 23:29:50','',0,'http://nina.local/?page_id=3',0,'page','',0);
