INSERT INTO `wp_postmeta` VALUES (9379,3,'_wp_suggested_privacy_policy_content','a:3:{s:11:"plugin_name";s:9:"WordPress";s:11:"policy_text";s:4986:"<h2 class="wp-block-heading">Quiénes somos</h2><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>La dirección de nuestra web es: https://ninayco.helloeveryone.me.</p><h2 class="wp-block-heading">Comentarios</h2><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Cuando los visitantes dejan comentarios en la web, recopilamos los datos que se muestran en el formulario de comentarios, así como la dirección IP del visitante y la cadena de agentes de usuario del navegador para ayudar a la detección de spam.</p><p>Una cadena anónima creada a partir de tu dirección de correo electrónico (también llamada hash) puede ser proporcionada al servicio de Gravatar para ver si la estás usando. La política de privacidad del servicio Gravatar está disponible aquí: https://automattic.com/privacy/. Después de la aprobación de tu comentario, la imagen de tu perfil es visible para el público en el contexto de tu comentario.</p><h2 class="wp-block-heading">Medios</h2><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Si subes imágenes a la web, deberías evitar subir imágenes con datos de ubicación (GPS EXIF) incluidos. Los visitantes de la web pueden descargar y extraer cualquier dato de ubicación de las imágenes de la web.</p><h2 class="wp-block-heading">Cookies</h2><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Si dejas un comentario en nuestro sitio puedes elegir guardar tu nombre, dirección de correo electrónico y web en cookies. Esto es para tu comodidad, para que no tengas que volver a rellenar tus datos cuando dejes otro comentario. Estas cookies tendrán una duración de un año.</p><p>Si tienes una cuenta y te conectas a este sitio, instalaremos una cookie temporal para determinar si tu navegador acepta cookies. Esta cookie no contiene datos personales y se elimina al cerrar el navegador.</p><p>Cuando accedas, también instalaremos varias cookies para guardar tu información de acceso y tus opciones de visualización de pantalla. Las cookies de acceso duran dos días, y las cookies de opciones de pantalla duran un año. Si seleccionas «Recuérdarme», tu acceso perdurará durante dos semanas. Si sales de tu cuenta, las cookies de acceso se eliminarán.</p><p>Si editas o publicas un artículo se guardará una cookie adicional en tu navegador. Esta cookie no incluye datos personales y simplemente indica el ID del artículo que acabas de editar. Caduca después de 1 día.</p><h2 class="wp-block-heading">Contenido incrustado de otros sitios web</h2><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Los artículos de este sitio pueden incluir contenido incrustado (por ejemplo, vídeos, imágenes, artículos, etc.). El contenido incrustado de otras webs se comporta exactamente de la misma manera que si el visitante hubiera visitado la otra web.</p><p>Estas web pueden recopilar datos sobre ti, utilizar cookies, incrustar un seguimiento adicional de terceros, y supervisar tu interacción con ese contenido incrustado, incluido el seguimiento de tu interacción con el contenido incrustado si tienes una cuenta y estás conectado a esa web.</p><h2 class="wp-block-heading">Con quién compartimos tus datos</h2><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Si solicitas un restablecimiento de contraseña, tu dirección IP será incluida en el correo electrónico de restablecimiento.</p><h2 class="wp-block-heading">Cuánto tiempo conservamos tus datos</h2><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Si dejas un comentario, el comentario y sus metadatos se conservan indefinidamente. Esto es para que podamos reconocer y aprobar comentarios sucesivos automáticamente, en lugar de mantenerlos en una cola de moderación.</p><p>De los usuarios que se registran en nuestra web (si los hay), también almacenamos la información personal que proporcionan en su perfil de usuario. Todos los usuarios pueden ver, editar o eliminar su información personal en cualquier momento (excepto que no pueden cambiar su nombre de usuario). Los administradores de la web también pueden ver y editar esa información.</p><h2 class="wp-block-heading">Qué derechos tienes sobre tus datos</h2><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Si tienes una cuenta o has dejado comentarios en esta web, puedes solicitar recibir un archivo de exportación de los datos personales que tenemos sobre ti, incluyendo cualquier dato que nos hayas proporcionado. También puedes solicitar que eliminemos cualquier dato personal que tengamos sobre ti. Esto no incluye ningún dato que estemos obligados a conservar con fines administrativos, legales o de seguridad.</p><h2 class="wp-block-heading">Dónde se envían tus datos</h2><p><strong class="privacy-policy-tutorial">Texto sugerido: </strong>Los comentarios de los visitantes puede que los revise un servicio de detección automática de spam.</p>";s:5:"added";i:1714519319;}');
INSERT INTO `wp_postmeta` VALUES (9380,3,'_wp_suggested_privacy_policy_content','a:3:{s:11:"plugin_name";s:11:"WooCommerce";s:11:"policy_text";s:4589:"<div class="wp-suggested-text"><p class="privacy-policy-tutorial">Este texto de muestra incluye los básicos sobre qué datos personales recopila, almacena y comparte tu tienda, así como quién tiene acceso a esos datos. Dependiendo de qué ajustes estén activos y qué plugins adicionales se use, la información específica compartida por tu tienda puede variar. Te recomendamos que consultes a un abogado para decidir qué información mostrar en tu política de privacidad.</p><p>Recopilamos información tuya durante el proceso de pago en nuestra tienda.</p><h2>Lo que recopilamos y almacenamos</h2><p>Mientras visitas nuestro sitio realizaremos el seguimiento de:</p><ul><li>Productos que has visto: Los usaremos para, por ejemplo, mostrarte los productos que has visto recientemente</li><li>Ubicación, dirección IP y tipo de navegador: usaremos esto para propósitos como estimar impuestos y costes de envío</li><li>Dirección de envío: te pediremos que facilites esto para que podamos, por ejemplo, estimar el coste del envío antes de que hagas un pedido, ¡y enviarte el pedido!</li></ul><p>También usamos cookies para realizar el seguimiento de los contenidos del carrito mientras navegas por nuestro sitio.</p><p class="privacy-policy-tutorial">Observación: puede que quieras detallar tu política de cookies, y enlazar desde aquí a esta sección.</p><p>Cuando nos compras algo te pedimos que facilites información que incluye tu nombre, dirección de facturación, dirección de envío, dirección de correo electrónico, número de teléfono, detalles de la tarjeta de crédito/pago e información adicional opcional como el nombre de usuario y la contraseña. Usaremos esta información para propósitos como:</p><ul><li>Enviarte información sobre tu cuenta y pedido</li><li>Responder a tus solicitudes, incluidos reembolsos y reclamaciones</li><li>Procesar pagos y evitar el fraude</li><li>Configurar tu cuenta para nuestra tienda</li><li>Cumplir con cualquier obligación legal que tengamos, como cálculos de impuestos</li><li>Mejorar las ofertas de nuestra tienda</li><li>Enviarte mensajes promocionales, si eliges recibirlos</li></ul><p>Si creas una cuenta almacenaremos tu nombre, dirección, correo electrónico y número de teléfono, lo que usaremos para el proceso de pago y futuros pedidos.</p><p>Normalmente almacenamos información sobre ti durante el tiempo que necesitemos la información para los propósitos para los que la recopilamos y usamos, y no estemos legalmente obligados a seguir guardándola. Por ejemplo, almacenaremos información de los pedidos durante XXX años para propósitos de impuestos y contabilidad. Esto incluye tu nombre, dirección de correo electrónico y direcciones de facturación y envío.</p><p>También almacenamos comentarios o valoraciones, si eliges dejarlos.</p><h2>Quién de nuestro equipo tiene acceso</h2><p>Los miembros de nuestro equipo tienen acceso a la información que nos ofreces. Por ejemplo, los administradores y gestores de tienda pueden acceder:</p><ul><li>La información de pedidos, como qué se compró, cuándo se compró y dónde se debería enviar, y</li><li>La información de cliente, como tu nombre, dirección de correo electrónico, y la información de facturación y envío.</li></ul><p>Los miembros de nuestro equipo tienen acceso a esta información para ayudar a completar pedidos, procesar reembolsos y darte soporte.</p><h2>Lo que compartimos con otros</h2><p class="privacy-policy-tutorial">En esta sección deberías apuntar con quién estás compartiendo datos, y con qué objetivo. Esto podría incluir, pero no está solo limitado a ello, análisis, marketing, pasarelas de pago, proveedores de envío, e incrustados de terceros.</p><p>Compartimos información con otros, que nos ayudan a ofrecer nuestros pedidos y gestionar servicios para ti; por ejemplo --</p><h3>Pagos</h3><p class="privacy-policy-tutorial">En esta subsección deberías apuntar qué otros procesadores de pago externos estás usando para admitir pagos en tu tienda, ya que puede que manejen datos de los clientes. Hemos incluido PayPal como ejemplo, pero deberías borrarlo si no estás usando PayPal.</p><p>Aceptamos pagos mediante PayPal. Al procesar pagos algunos de tus datos se pasarán a PayPal, incluida la información requerida para procesar o dar soporte al pago, tales como el total de la compra y la información de facturación.</p><p>Por favor, revisa la <a href="https://www.paypal.com/es/webapps/mpp/ua/privacy-full">política de privacidad de PayPal</a> para más detalles.</p></div>";s:5:"added";i:1714519319;}');
INSERT INTO `wp_postmeta` VALUES (9381,3,'_wp_suggested_privacy_policy_content','a:3:{s:11:"plugin_name";s:14:"Loco Translate";s:11:"policy_text";s:237:"Este plugin no recoge datos de los visitantes de la parte pública de la web.<br />Es posible que los administradores o auditores quieran revisar el <a href="https://localise.biz/wordpress/plugin/privacy">aviso de privacidad</a> de Loco.";s:5:"added";i:1714519319;}');
