INSERT INTO `wp_options` VALUES (7401,'cerber_admin_info','<h1>Highlights from WP Cerber Security 9.6.2</h1><ul><li>New: Introduced an admin tool that provides clear explanations of security events in WP Cerber logs and security settings WP Cerber applied in processing requests.</li><li>New: Implemented settings for configuring header-based exceptions for WP Cerber&rsquo;s anti-spam and firewall.</li><li>Improved: A new activity log event, &quot;Comment marked as spam&quot;, to simplify spam comment management and related plugin settings.</li><li>Improved: A new quick filter, &quot;Spam Events&quot; on the Activity tab. It helps admins to easily view all spam-related events and actions taken by WP Cerber&rsquo;s anti-spam.</li><li>Improved: WP Cerber now logs the reasons for blocking IP addresses with better accuracy making it simpler to discern the root cause of lockouts.</li><li>Improved: To mitigate plugin conflicts, implemented a dequeuing mechanism that removes conflicting JavaScript scripts loaded by other plugins on WP Cerber admin pages.</li><li>Improved: The layout of several WP Cerber admin settings pages and translations have been improved for better admin experience.</li></ul><p style="margin-top: 18px; line-height: 1.3;"><span class="dashicons-before dashicons-info-outline"></span>  &nbsp; <a href="https://wpcerber.com/?plugin_version=9.6.2" target="_blank">Read more on wpcerber.com</a></p>	<p style="margin-top: 24px;"><span class="dashicons-before dashicons-email-alt"></span> &nbsp; <a href="https://wpcerber.com/subscribe-newsletter/">Subscribe to Cerber\'s newsletter</a></p>\r\n					<p><span class="dashicons-before dashicons-twitter"></span> &nbsp; <a href="https://twitter.com/wpcerber">Follow Cerber on X</a></p>\r\n					<p><span class="dashicons-before dashicons-facebook"></span> &nbsp; <a href="https://www.facebook.com/wpcerber/">Follow Cerber on Facebook</a></p>\r\n				<p style="text-align:right; padding-right: 20px;">\r\n    		    <input type="button" class="button button-primary cerber-dismiss" value=" &nbsp; ¡Asombroso! &nbsp; "/></p>','no');
