equires";s:3:"6.4";s:6:"tested";s:5:"6.5.2";s:12:"requires_php";s:3:"7.4";s:16:"requires_plugins";a:0:{}s:6:"rating";i:90;s:7:"ratings";a:5:{i:5;i:3537;i:4;i:175;i:3;i:97;i:2;i:97;i:1;i:384;}s:11:"num_ratings";i:4290;s:11:"support_url";s:49:"https://wordpress.org/support/plugin/woocommerce/";s:15:"support_threads";i:1481;s:24:"support_threads_resolved";i:1126;s:15:"active_installs";i:5000000;s:12:"last_updated";s:22:"2024-04-30 11:42am GMT";s:5:"added";s:10:"2011-09-27";s:8:"homepage";s:24:"https://woocommerce.com/";s:8:"sections";a:6:{s:11:"description";s:13130:"<p><a href="https://woo.com/woocommerce/" rel="nofollow ugc">WooCommerce</a>es la plataforma de comercio electrónico de código abierto para WordPress.</p>\n<p>Nuestra plataforma central es gratuita y flexible, y se ha ampliado gracias a la comunidad global. La libertad que proporciona el código abierto significa que podrás conservar la propiedad completa del contenido y los datos de tu tienda para siempre.</p>\n<p>Tanto si emprendes un negocio como si realizas la actividad comercial en tiendas físicas en línea o desarrollas sitios para clientes, utiliza WooCommerce para que tu tienda pueda aprovechar la combinación de contenido y comercio.</p>\n<ul>\n<li><strong>Crea escaparates bonitos y atractivos</strong> con <a href="https://woocommerce.com/product-category/themes/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">temas</a> apropiados para tu marca y sector.</li>\n<li><strong>Aumenta tus ingresos</strong> con una <a href="https://woo.com/checkout-blocks/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">experiencia de carrito de compra optimizada</a> que convierte.</li>\n<li><strong>Personaliza las páginas de tus productos en cuestión de minutos</strong> mediante los <a href="https://docs.woocommerce.com/document/woocommerce-blocks/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">bloques de producto</a> modulares.</li>\n<li>Muestra productos físicos y digitales, variaciones de productos, configuraciones personalizadas, descargas instantáneas y artículos de afiliados.</li>\n<li>Vende <a href="https://woocommerce.com/products/woocommerce-subscriptions/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">suscripciones</a>, <a href="https://woocommerce.com/products/woocommerce-bookings/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">reservas</a> o <a href="https://woocommerce.com/products/woocommerce-memberships/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">membresías</a>, con nuestras extensiones validadas por desarrolladores.</li>\n<li><strong>Consigue aparecer en los primeros resultados</strong> gracias a la <a href="https://www.searchenginejournal.com/wordpress-best-cms-seo/" rel="nofollow ugc">ventaja SEO de WordPress</a>.</li>\n<li><strong>Creado en una plataforma que crece.</strong> Consigue un comercio electrónico flexible para <a href="https://woo.com/high-volume-stores/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">tiendas de gran volumen</a>.</li>\n</ul>\n<h4>TODAS LAS HERRAMIENTAS QUE NECESITAS PARA VENDER</h4>\n<p>Las herramientas incorporadas y las integraciones conocidas te ayudarán a gestionar de manera eficiente tus operaciones comerciales. Puedes añadir muchos servicios gratuitamente mediante un solo clic a través del <a href="https://docs.woocommerce.com/document/woocommerce-setup-wizard/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">asistente de configuración</a> opcional.</p>\n<ul>\n<li><strong>Elige cómo quieres que te paguen</strong>. Gestiona fácilmente los pagos desde la comodidad de tu tienda con <a href="https://woocommerce.com/payments/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">WooCommerce Payments</a> (Disponible en los EEUU, Reino Unido, Irlanda, Australia, Nueva Zelanda, Canada, España, Francia, Alemania e Italia). Acepta de manera segura tarjetas de crédito, monederos móviles, transferencias bancarias y efectivo gracias a <a href="https://woocommerce.com/product-category/woocommerce-extensions/payment-gateways/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">más de 100 pasarelas de pago</a> – incluyendo <a href="https://woocommerce.com/products/stripe/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Stripe</a>, <a href="https://woocommerce.com/products/woocommerce-gateway-paypal-checkout/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">PayPal</a> y <a href="https://woocommerce.com/products/square/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Square</a>.</li>\n<li><strong>Configura tus opciones de envío</strong>. Imprime etiquetas de USPS desde tu escritorio e incluso programa recogidas con <a href="https://woocommerce.com/products/shipping/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">WooCommerce Shipping</a> (solo en los EEUU). Conecta con <a href="https://woocommerce.com/product-category/woocommerce-extensions/shipping-methods/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">conocidos transportistas</a> como UPS y FedEx – además de una amplia variedad de soluciones de entrega, inventario y suministro para tu negocio local.</li>\n<li><strong>Simplifica los impuestos de ventas</strong>. Añade <a href="https://woocommerce.com/products/tax/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">WooCommerce Tax</a> o <a href="https://woocommerce.com/product-category/woocommerce-extensions/tax?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">servicios similares integrados</a> para que los cálculos automatizados se conviertan en realidad.</li>\n</ul>\n<h4>Haz crecer tu negocio, añade características, y haz seguimiento de tu tienda sobre la marcha</h4>\n<p>WooCommerce significa actividad comercial. Conserva las pestañas sobre las métricas de rendimiento más importantes para ti con <a href="https://wordpress.org/plugins/woocommerce-admin/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="ugc">WooCommerce Admin</a>, un escritorio central potente y personalizable para tu tienda.</p>\n<p>Amplía tu audiencia en los canales sociales y de marketing con <a href="https://woocommerce.com/products/google-ads/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Google Ads</a>, <a href="https://woocommerce.com/products/hubspot-for-woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">HubSpot</a>, <a href="https://woocommerce.com/products/mailchimp-for-woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Mailchimp</a> e integraciones de <a href="https://woocommerce.com/products/facebook/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Facebook</a>. Siempre puedes consultar el <a href="https://docs.woocommerce.com/document/marketing-hub/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">centro de marketing</a> del escritorio para obtener ideas y consejos nuevos que te ayuden a conseguir el éxito.</p>\n<p>Mejora la funcionalidad de la tienda con cientos de extensiones gratis y de pago del <a href="https://woocommerce.com/products/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">mercado oficial de WooCommerce</a>. Nuestros desarrolladores <a href="https://docs.woocommerce.com/document/marketplace-overview/#section-6?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">validan cada nueva extensión</a> y revisan regularmente las extensiones existentes para mantener los estándares de calidad del mercado. Buscamos activamente <a href="https://docs.woocommerce.com/document/marketplace-overview/#section-2?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">productos que ayuden a los creadores de tiendas a crear tiendas con éxito</a>.</p>\n<p>Gestiona tu tienda desde cualquier sitio con la <a href="https://woocommerce.com/mobile/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">aplicación para dispositivos móviles</a> (Android y iOS) de WooCommerce. Alerta de spoiler: intenta obviar el adictivo sonido de notificación cada vez que consigas una nueva venta.</p>\n<h4>Posee y controla los datos de tu tienda – siempre</h4>\n<p>Con <a href="https://woo.com/woocommerce/" rel="nofollow ugc">WooCommerce</a>, tus datos son tuyos. Siempre.</p>\n<p>Si optas por compartir <a href="https://woocommerce.com/usage-tracking/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">datos sobre el uso</a> con nosotros, puedes estar seguro de que seguirán siendo anónimos y estarán protegidos. Puedes desactivar la opción de compartir datos sobre el uso sin que afecte a tu tienda.</p>\n<p>A diferencia de las soluciones de comercio electrónico alojadas, los datos de una tienda WooCommerce están preparados para el futuro; eres libre de exportar todo tu contenido y llevar tu sitio a cualquier plataforma que elijas. No hay restricciones.</p>\n<h4>Por qué los desarrolladores eligen (y les encanta) WooCommerce</h4>\n<p>Los desarrolladores pueden usar <a href="https://woo.com/woocommerce/" rel="nofollow ugc">WooCommerce</a> para crear, personalizar y escalar una tienda para cumplir con las especificaciones exactas de un cliente, y realizar mejoras a través de extensiones o soluciones personalizadas.</p>\n<ul>\n<li>Aprovecha los <a href="https://docs.woocommerce.com/document/introduction-to-hooks-actions-and-filters/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">ganchos y filtros</a> para modificar o crear la funcionalidad.</li>\n<li>Integra prácticamente cualquier servicio mediante una <a href="https://docs.woocommerce.com/document/woocommerce-rest-api/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">API de REST</a> sólida y webhooks.</li>\n<li>Diseña y crea bloques de contenido personalizados con React.</li>\n<li><a href="https://docs.woocommerce.com/documentation/plugins/woocommerce/woocommerce-codex/extending/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Examina y modifica</a> cualquier aspecto del código del plugin central.</li>\n<li>Acelera el desarrollo con una <a href="https://woocommerce.github.io/code-reference/classes/wc-cli-rest-command.html?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">CLI</a> ultrarrápida.</li>\n</ul>\n<p>La plataforma central se prueba de forma rigurosa y frecuente con el apoyo de un equipo de desarrollo dedicado que trabaja en distintas zonas horarias. La documentación completa se actualiza con cada versión, lo que te permite crear exactamente la tienda que necesitas.</p>\n<h4>Sé parte de una comunidad internacional creciente</h4>\n<p>WooCommerce tiene una comunidad grande y apasionada dedicada a ayudar a los comerciantes a tener éxito &#8211; y está creciendo rápidamente.</p>\n<p>Hay <a href="https://woocommerce.com/meetups/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">encuentros de WooCommerce</a> en ciudades en todo el mundo a los que puedes asistir gratis y en los que puedes participar para la puesta en marcha. Estos eventos son una forma fantástica de aprender de los demás, compartir tus conocimientos y encontrar gente con intereses comunes.</p>\n<p>WooCommerce también está presente normalmente en los WordCamps de todo el mundo. Nos encantaría verte allí.</p>\n<h4>Contribuye y traduce</h4>\n<p>Automattic, la empresa creadora de WordPress.com y Jetpack, es la encargada del desarrollo y soporte de WooCommerce. También contamos con la ayuda de una gran cantidad de colaboradores independientes, y sigue habiendo espacio para muchos más. Dirígete al <a href="https://github.com/woocommerce/woocommerce?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">repositorio de GitHub de WooCommerce</a> para ver cómo puedes colaborar.</p>\n<p>WooCommerce se ha traducido a varios idiomas, incluidos el danés, el ucraniano y el persa. Ayúdanos a mejorar la traducción de WooCommerce añadiendo tu configuración regional: visita <a href="https://translate.wordpress.org/projects/wp-plugins/woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">translate.wordpress.org</a>.</p>\n";s:12:"installation";s:2760:"<h4>Requisitos mínimos</h4>\n<ul>\n<li>Se necesita la versión PHP 7.4 o superior (se recomienda la versión PHP 8.0 o superior)</li>\n<li>Se necesitan las versiones MySQL 5.6 o superior o MariaDB 10.1 o superior.</li>\n</ul>\n<p>Visita la <a href="https://docs.woocommerce.com/document/server-requirements/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6" rel="nofollow ugc">documentación sobre requisitos del servidor para WooCommerce</a> para obtener una lista detallada de los requisitos del servidor.</p>\n<h4>Instalación automática</h4>\n<p>La instalación automática es la opción más sencilla, ya que WordPress gestiona las transferencias de archivos y no tendrás que salir de tu navegador web. Para hacer una instalación automática de WooCommerce, accede a tu escritorio de WordPress, ve al menú de plugins y haz clic en «Añadir nuevo».</p>\n<p>En el campo de búsqueda teclea «WooCommerce» y haz clic en «Buscar plugins». Una vez que nos hayas encontrado, puedes ver los detalles, como la versión, la clasificación y la descripción. ¡Lo más importante, por supuesto, es que puedas instalarlo! Haz clic en «Instalar ahora» y WordPress se encargará de ello.</p>\n<h4>Instalación manual</h4>\n<p>El método de instalación manual pasa por descargar el plugin WooCommerce y subirlo a tu servidor mediante tu aplicación FTP favorita. El codex de WordPress tiene <a href="https://wordpress.org/support/article/managing-plugins/#manual-plugin-installation" rel="ugc">instrucciones de cómo se hace</a>.</p>\n<h4>Actualizaciones</h4>\n<p>Las actualizaciones automáticas deberían funcionar sin problemas, pero aún así te recomendamos que hagas una copia de seguridad de tu sitio.</p>\n<p>Si por algún motivo tienes problemas con las páginas de tienda/categoría después de actualizar, solo tienes que forzar los enlaces permanentes yendo a WordPress &gt; Ajustes &gt; Enlaces permanentes y pulsando en «Guardar». Esto debería devolver las cosas a la normalidad.</p>\n<h4>Datos de ejemplo</h4>\n<p>WooCommerce viene con algunos datos de muestra que puedes usar para ver qué aspecto tienen los productos; importa el archivo «sample_products.xml» con el <a href="https://wordpress.org/plugins/wordpress-importer/" rel="ugc">importador de WordPress</a>. También puedes usar el <a href="https://docs.woocommerce.com/document/product-csv-importer-exporter/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6" rel="nofollow ugc">importador CSV</a> del núcleo o nuestra <a href="https://woocommerce.com/products/product-csv-import-suite/?utm_source=wp%20org%20repo%20listing&amp;utm_content=3.6" rel="nofollow ugc">extensión de solución completa de importación CSV</a> para importar el archivo «sample_products.csv»</p>\n";s:3:"faq";s:8486:"\n<dt id=\'where%20can%20i%20find%20woocommerce%20documentation%20and%20user%20guides%3F\'>\n¿Dónde puedo encontrar documentación y guías de uso de WooCommerce?\n</h4>\n<p>\n<p>Para obtener ayuda para configurar WooCommerce, consulta la <a href="https://docs.woocommerce.com/documentation/plugins/woocommerce/getting-started/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">guía de inicio</a> y la <a href="https://woocommerce.com/guides/new-store/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">nueva guía para propietarios de la tiendas de WooCommerce</a>.</p>\n<p>Para ampliar o tematizar WooCommerce, consulta nuestro <a href="https://docs.woocommerce.com/documentation/plugins/woocommerce/woocommerce-codex/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">códex</a>, así como el <a href="https://docs.woocommerce.com/document/create-a-plugin/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">manual del desarrollador de plugins</a>.</p>\n</p>\n<dt id=\'where%20can%20i%20get%20help%20or%20talk%20to%20other%20users%20about%20woocommerce%20core%3F\'>\n¿Dónde puedo obtener ayuda o hablar con otros usuarios sobre el núcleo de WooCommerce?\n</h4>\n<p>\n<p>Si continúas teniendo problemas, puedes solicitar ayuda en el <a href="https://wordpress.org/support/plugin/woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="ugc">foro de soporte de WooCommerce</a> siguiendo <a href="https://wordpress.org/support/topic/guide-to-the-woocommerce-forum/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="ugc">estas directrices</a>. También puedes contactar a través de <a href="https://woocommerce.com/community-slack/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">WooCommerce Community Slack</a> o publicar una entrada en el <a href="https://www.facebook.com/groups/advanced.woocommerce?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">grupo de la comunidad de WooCommerce</a> en Facebook.</p>\n</p>\n<dt id=\'where%20can%20i%20get%20help%20for%20extensions%20i%20have%20purchased%20from%20the%20woocommerce%20marketplace%3F\'>\n¿Dónde puedo obtener ayuda para las extensiones que he comprado del mercado de WooCommerce?\n</h4>\n<p>\n<p>Para obtener ayuda en relación con las extensiones de pago de WooCommerce.com Marketplace: primero, revisa nuestra <a href="https://docs.woocommerce.com/document/woocommerce-self-service-guide/" rel="nofollow ugc">guía de solución de problemas de autoservicio</a>. Si el problema continúa, registra un ticket de soporte a través de <a href="https://woocommerce.com/my-account/create-a-ticket/" rel="nofollow ugc">nuestro servicio de asistencia</a>. Nuestros Happiness Engineers te responderán en un plazo de 24 horas.</p>\n</p>\n<dt id=\'i%E2%80%99m%20having%20trouble%20logging%20in%20to%20woocommerce.com%20%E2%80%93%20what%20now%3F\'>\nEstoy teniendo problemas al acceder a WooCommerce.com &#8211; ¿qué hago?\n</h4>\n<p>\n<p>Primero, soluciona los problemas de inicio de sesión frecuentes mediante está útil <a href="https://docs.woocommerce.com/document/log-into-woocommerce-com-with-wordpress-com/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">guía paso a paso</a>. ¿Sigue sin funcionar? <a href="https://woocommerce.com/contact-us/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Ponte en contacto con nosotros</a>.</p>\n</p>\n<dt id=\'will%20woocommerce%20work%20with%20my%20theme%3F\'>\n¿Funcionará WooCommerce con mi tema?\n</h4>\n<p>\n<p>Sí. WooCommerce funcionará con cualquier tema, pero es posible que requiera algún estilo adicional. Si buscas un tema que ofrezca una integración profunda con WooCommerce, recomendamos <a href="https://woocommerce.com/storefront/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Storefront</a>.</p>\n</p>\n<dt id=\'how%20do%20i%20update%20woocommerce%3F\'>\n¿Cómo actualizo WooCommerce?\n</h4>\n<p>\n<p>Disponemos de una guía detallada sobre <a href="https://docs.woocommerce.com/document/how-to-update-woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">cómo actualizar WooCommerce</a>.</p>\n</p>\n<dt id=\'my%20site%20broke%20%E2%80%93%20what%20do%20i%20do%3F\'>\nMi sitio está roto &#8211; ¿qué hago?\n</h4>\n<p>\n<p>Primero diagnostica el problema mediante nuestra útil <a href="https://docs.woocommerce.com/documentation/get-help/troubleshooting-get-help/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">guía de solución de problemas</a>.</p>\n<p>Si has detectado el error después de actualizar un tema o plugin, es posible que haya problemas de compatibilidad entre ellos y WooCommerce. Si el problema apareció después de actualizar WooCommerce, es posible que haya un conflicto entre WooCommerce y un tema o plugin obsoletos.</p>\n<p>En ambas instancias, recomendamos realizar una prueba de conflictos mediante <a href="https://docs.woocommerce.com/document/troubleshooting-using-health-check/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">Health Check</a> (que te permite deshabilitar temas y plugins sin que afecte a los visitantes) o aplicar la solución de problemas mediante un <a href="https://docs.woocommerce.com/document/how-to-test-for-conflicts/#section-3?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">sitio de pruebas</a>.</p>\n</p>\n<dt id=\'where%20can%20i%20report%20bugs%3F\'>\n¿Dónde puedo informar de fallos?\n</h4>\n<p>\n<p>Informa de los errores en el <a href="https://github.com/woocommerce/woocommerce/issues?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">repositorio de GitHub de WooCommerce</a>. También puedes informarnos a través del foro de soporte. Busca el error en los foros para asegurarte de que no se haya informado ya de él.</p>\n</p>\n<dt id=\'where%20can%20i%20request%20new%20features%2C%20themes%2C%20and%20extensions%3F\'>\n¿Dónde puedo solicitar nuevas características, temas y extensiones?\n</h4>\n<p>\n<p>Solicita nuevas funciones y extensiones, y vota las sugerencias existentes en nuestro <a href="https://woocommerce.com/feature-requests/woocommerce?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">panel de ideas</a> oficial. Nuestros equipos de productos revisan regularmente las solicitudes y las tienen en cuenta en la planificación de los productos.</p>\n</p>\n<dt id=\'woocommerce%20is%20awesome%21%20can%20i%20contribute%3F\'>\n¡WooCommerce es alucinante! ¿Puedo contribuir?\n</h4>\n<p>\n<p>¡Sí, puedes! Únete a nuestro <a href="https://github.com/woocommerce/woocommerce/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">repositorio en GitHub</a> y sigue el <a href="https://woocommerce.wordpress.com/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">blog de desarrollo</a> para estar al día de todo lo que pasa en el proyecto.</p>\n</p>\n<dt id=\'where%20can%20i%20find%20rest%20api%20documentation%3F\'>\n¿Dónde puedo encontrar la documentación de la API REST?\n</h4>\n<p>\n<p>Amplia <a href="https://woocommerce.github.io/woocommerce-rest-api-docs/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">documentación sobre la API REST de WooCommerce</a> disponible en GitHub.</p>\n</p>\n<dt id=\'my%20question%20is%20not%20listed%20here.%20where%20can%20i%20find%20more%20answers%3F\'>\nMi pregunta no está en esta lista. ¿Dónde puedo encontrar más respuestas?\n</h4>\n<p>\n<p>Echa un vistazo a las <a href="https://woo.com/document/frequently-asked-questions/?utm_medium=referral&amp;utm_source=wordpress.org&amp;utm_campaign=wp_org_repo_listing" rel="nofollow ugc">preguntas frecuentes</a> para más información.</p>\n</p>\n\n";s:9:"changelog";s:514:"<h4>8.8.3 2024-04-29</h4>\n<ul>\n<li>Actualización &#8211; Revierte la auto-inyección de Bloques Woo específicos en todos los temas de bloques y restaura sólo la auto-inyección en los temas que se encuentran en la lista de permitidos. <a href="https://github.com/woocommerce/woocommerce/pull/46935" rel="nofollow ugc">#46935</a></li>\n</ul>\n<p><a href="https://raw.githubusercontent.com/woocommerce/woocommerce/trunk/changelog.txt" rel="nofollow ugc">Ver el registro de cambios para todas las versiones</a>.</p>\n";s:11:"screenshots";s:1035:"<ol><li><a href="https://ps.w.org/woocommerce/assets/screenshot-1.jpg?rev=2366418"><img src="https://ps.w.org/woocommerce/assets/screenshot-1.jpg?rev=2366418" alt=""></a></li><li><a href="https://ps.w.org/woocommerce/assets/screenshot-2.jpg?rev=2366418"><img src="https://ps.w.org/woocommerce/assets/screenshot-2.jpg?rev=2366418" alt=""></a></li><li><a href="https://ps.w.org/woocommerce/assets/screenshot-3.jpg?rev=2366418"><img src="https://ps.w.org/woocommerce/assets/screenshot-3.jpg?rev=2366418" alt=""></a></li><li><a href="https://ps.w.org/woocommerce/assets/screenshot-4.jpg?rev=2366418"><img src="https://ps.w.org/woocommerce/assets/screenshot-4.jpg?rev=2366418" alt=""></a></li><li><a href="https://ps.w.org/woocommerce/assets/screenshot-5.jpg?rev=2366418"><img src="https://ps.w.org/woocommerce/assets/screenshot-5.jpg?rev=2366418" alt=""></a></li><li><a href="https://ps.w.org/woocommerce/assets/screenshot-6.jpg?rev=2366418"><img src="https://ps.w.org/woocommerce/assets/screenshot-6.jpg?rev=2366418" alt=""></a></li></ol>";s:7:"reviews";s:16805:"<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Helpful support</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="4 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="4" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-empty"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/tipsyhues/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/1234381df611883cd70f7252e4e274e2?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/1234381df611883cd70f7252e4e274e2?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/tipsyhues/" class="reviewer-name">tipsyhues</a> el <span class="review-date">abril 30, 2024</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>I\'m still working out a few kinks in the system, but support is helpful and really seem like they care about getting any problems resolved.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Great Support!</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/benedictb/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/75994aa23f238738168f121e6f447b95?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/75994aa23f238738168f121e6f447b95?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/benedictb/" class="reviewer-name">benedictb</a> el <span class="review-date">abril 26, 2024</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>Having a free support service like this is amazing, super helpful with problem-solving and spotting issues in minutes we haven\'t spotted in years! Quick and kind responses, you couldn\'t ask for more.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Хороший плагин, всё работает отлично!</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/denysoftru/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/a912f36d96823fc5280b8e02ac4facf0?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/a912f36d96823fc5280b8e02ac4facf0?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/denysoftru/" class="reviewer-name">denysoftru</a> el <span class="review-date">abril 24, 2024</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>Хороший плагин, всё работает отлично!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Tres utile</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/gwenole100/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/806282144c08654e2a75a6420551ea91?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/806282144c08654e2a75a6420551ea91?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/gwenole100/" class="reviewer-name">gwenole100</a> el <span class="review-date">abril 23, 2024</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>Produit utile pour mon activité par sa souplesse</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Great plugin, and excellent support!</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/niceneedle/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/b00e4456af84378a5923b13385f413d5?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/b00e4456af84378a5923b13385f413d5?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/niceneedle/" class="reviewer-name">Joanna Gil <small>(niceneedle)</small></a> el <span class="review-date">abril 21, 2024</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>I have more than 4 years using this plugin, and it works perfectly. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>What truly sets this plugin apart is the exceptional support team behind it. Whenever I\'ve had a question or encountered an issue, they have been incredibly responsive and helpful. Their dedication to customer satisfaction is truly commendable.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Overall, I highly recommend this plugin to anyone looking for a reliable solution for their tax needs. Thank you to the team for creating such a great product and providing excellent support!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Good Support Experience</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/faheemahmed/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/93275de4a7fe939c6f056f50a8f59aa3?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/93275de4a7fe939c6f056f50a8f59aa3?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/faheemahmed/" class="reviewer-name">faheemahmed</a> el <span class="review-date">abril 20, 2024</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>Good experience with support.</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Bad</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="1 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="1" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-empty"></span><span class="star dashicons dashicons-star-empty"></span><span class="star dashicons dashicons-star-empty"></span><span class="star dashicons dashicons-star-empty"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/cryptrz/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/58948533aee70ecf8ed61fcecc7de311?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/58948533aee70ecf8ed61fcecc7de311?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/cryptrz/" class="reviewer-name">cryptrz</a> el <span class="review-date">abril 17, 2024</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>Making the uninstall so annoying is not very smart</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">the plugin not working</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/cserma1995/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/0875d9e6404e887c4717475c5df4cb3d?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/0875d9e6404e887c4717475c5df4cb3d?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/cserma1995/" class="reviewer-name">cserma1995</a> el <span class="review-date">abril 17, 2024</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p>I install the last version and de woocommerce plugin dont send any data by webhook.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>When I try to modify any webhook appears this error:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>Error: Delivery URL cannot be reached: cURL error 28: Operation timed out after 5001 milliseconds with 0 bytes received</strong></p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">WooCommerce, an e-commerce platform beyond expectations</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/ptienhung/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/e952b801d095c2e2a79075f9235e192c?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/e952b801d095c2e2a79075f9235e192c?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/ptienhung/" class="reviewer-name">ptienhung</a> el <span class="review-date">abril 17, 2024</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p class="">The WooCommerce plugin is an excellent and indispensable tool for anyone looking to build and manage their online store on the WordPress platform. With its flexibility and diverse range of features, WooCommerce not only provides tangible value to e-commerce businesses but also actively contributes to the development of the global e-commerce community.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p class="">One of WooCommerce\'s prominent strengths is its high level of customization, allowing users to create online stores according to their preferences. From product management to payment processing, from order management to interface customization, everything can be adjusted flexibly and easily.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p class="">Furthermore, the large and active WooCommerce community is also a crucial factor in the success of this platform. The sharing of knowledge, various extensions, and helpful resources are constantly updated, enabling users to optimize their experience and quickly address any issues they encounter.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p class="">Last but not least, we cannot overlook the technical support team of WooCommerce, who are always ready to assist and guide users in any situation. Their enthusiasm and professionalism truly shine, providing users with a sense of reassurance and confidence when using this product.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p class="">In conclusion, WooCommerce is not just a powerful e-commerce plugin but also a robust community and support network. With its combination of flexibility, power, and professional support, WooCommerce truly deserves high praise and is the top choice for anyone looking to start an online business on the WordPress platform.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p class="">Thank you so much!</p>\n<!-- /wp:paragraph --></div>\n</div>\n<div class="review">\n	<div class="review-head">\n		<div class="reviewer-info">\n			<div class="review-title-section">\n				<h4 class="review-title">Configuration issue resolved</h4>\n				<div class="star-rating">\n				<div class="wporg-ratings" aria-label="5 de 5 estrellas" data-title-template="%s de 5 estrellas" data-rating="5" style="color:#ffb900;"><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span><span class="star dashicons dashicons-star-filled"></span></div>				</div>\n			</div>\n			<p class="reviewer">\n				Por <a href="https://profiles.wordpress.org/naud06000/"><img alt=\'\' src=\'https://secure.gravatar.com/avatar/b83e129ea37baea944aff6ea4c04996a?s=16&#038;d=monsterid&#038;r=g\' srcset=\'https://secure.gravatar.com/avatar/b83e129ea37baea944aff6ea4c04996a?s=32&#038;d=monsterid&#038;r=g 2x\' class=\'avatar avatar-16 photo\' height=\'16\' width=\'16\' loading=\'lazy\' decoding=\'async\'/></a><a href="https://profiles.wordpress.org/naud06000/" class="reviewer-name">naud06000</a> el <span class="review-date">abril 14, 2024</span>			</p>\n		</div>\n	</div>\n	<div class="review-body"><!-- wp:paragraph -->\n<p class="">Technical support gave me the help I expected. Thank you so much.</p>\n<!-- /wp:paragraph --></div>\n</div>\n";}s:17:"short_description";s:196:"Todo lo que necesitas para publicar una tienda en línea en pocos días y seguir creciendo durante años. WooCommerce crece contigo, desde tu primera venta hasta que alcances ingresos millonarios.";s:13:"download_link";s:60:"https://downloads.wordpress.org/plugin/woocommerce.8.8.3.zip";